ADOBE PHOTOSHOP CS5 TRAINING MANUAL FOR WINDOWS &amp; MAC

Photoshop CS5 Restoration and Retouching For Digital Photographers Only

Adobe Photoshop CS5 Restoration and Retouching For Digital Photographers Only is the complete guide to restoration and retouching. Whether youre new to Photoshop, or if youve been using it for years, youll learn lots of new tricks that will help put the beauty back into cherished family photos, and turn new photos into frameable works of art.

Follow Adobe Certified Photoshop Expert Mark Fitzgerald as he guides you through the restoration and retouching workflows. Begin by learning about basic concepts, such as proper tonal and color adjustment, selections, and masking. Then learn to master Photoshops retouching tools, like the Healing Brush, Patch Tool, and Clone Stamp. After you build a solid foundation, youll see how these tools and techniques come together to solve a wide range of restoration and retouching problems; from repairing a damaged print to removing braces and repairing glass glares.

Explore the tools and techniques with step-by-step expert instructions for downloadable practice files. Experience the total workflow as you complete three projects along side Mark from start to finish: a restoration project, a portrait retouching project, and an architectural retouching project. 

